$(function(){$("li:first-child").addClass("first");$("li:last-child").addClass("last");$("tr:nth-child(odd)").addClass("alter");$('[href="#"]').attr("href","javascript:;");now=new Date;thecopyrightYear=now.getYear();if(thecopyrightYear<1900)thecopyrightYear=thecopyrightYear+1900;$("#cur-date").replaceWith('<span id="cur-date">'+thecopyrightYear+"</span>")

// Country List Data Fill
var ctrycode=1, calby = "noip"; //------------------------------Change Country Code here if required.
$.ajax({type:"GET",url:"/assets2/js/countrylist.xml",dataType:"xml",success:function(xml){$(xml).find('country').each(function(){var name=$(this).find('name').text();var abbr=$(this).find('abbr').text();var code=$(this).find('code').text();$('.jform select.countrylist').append('<option value="'+code+'" data-abbr="'+abbr+'">'+name+'</option>');
if(calby=="noip"){
/* Static Country Select */
$('.jform select.countrylist option[value="'+ctrycode+'"]').attr('selected','selected');$('.jform input[name="code"]').val('+'+ctrycode);$('.jform input[name="ctry"]').val($('.jform select.countrylist option:selected').html());
} else if(calby=="ip"){
/* Geo IP Country Select */
var ctrycode1 = geoip_country_code(), tgtctry = $('.jform select.countrylist option[data-abbr="'+ctrycode1+'"]');
tgtctry.attr('selected','selected');$('.jform input[name="code"]').val('+'+tgtctry.attr('value'));$('.jform input[name="ctry"]').val($('.jform select.countrylist option:selected').html());}})}});

// Code change on select
$('.jform select.countrylist[name="pc"]').each(function(){var id=$(this).parents('.jform').parent().attr('id');$(this).bind('change',function(){var cval=$(this).children('option:selected').attr('value');cnam=$(this).children('option:selected').html();$('#'+id+' .jform input[name="code"]').val('+'+cval);$('#'+id+' .jform input[name="ctry"]').val(cnam)});$('#'+id+' .jform select.countrylist[name="apc"]').bind('change',function(){var cval=$(this).children('option:selected').attr('value');$('#'+id+' .jform input[name="acode"]').val('+'+cval)});});

// Numbers only for phone number field
$('[name="pn"]').each(function(){if($(this).attr('type')=="text"){$(this).attr('onkeypress','return numbersonly(this, event)');} $(this).attr('minlength', 7)});
$('[name="cn"]').each(function(){$(this).attr('minlength', 2)})
// Password No space
$('input[type="password"]').keypress(function(e){if(e.which === 32)return false;});


if($.browser.msie&&$.browser.version<=9){
    $('input[type="text"], input[type="password"], input[type="email"], textarea').each(function(){
        var txtvalue=$(this).attr('placeholder');$(this).attr('value',txtvalue)
    });
    $('input[type="text"], input[type="password"], input[type="email"], textarea').on('focus',function(){
        var maintxt=$(this).attr('placeholder');
        if($(this).attr('value')==maintxt){$(this).attr('value','')}
    }).blur(function(){
            var maintxt=$(this).attr('placeholder');
            if($(this).attr('value')==''){
                $(this).attr('value',maintxt)
            }
        }
)}

// Validations ------------------------------------------------------------------
$('.validate').each(function(){
    var id=$(this).parent().attr('id'), 
    cnval = $('#'+id+' .jform').find('[name="cn"]').attr('placeholder'); 
    var msgval = $('#'+id+' .jform').find('[name="msg"]').attr('placeholder');
    pwdval = $('#'+id+' .jform').find('[name="pwd"]').attr('placeholder');
    if($.browser.msie&&$.browser.version<=9){
        jQuery.validator.addMethod("iecn", function(value, element){ switch (element.value){case cnval:if (element.name == cnval)return false;break;default:return true;break;}});
        jQuery.validator.addMethod("iemsg", function(value, element){ switch (element.value){case $(element).attr('placeholder'):if ( element.value == $(element).attr('placeholder') )return false;break;default:return true;break;}});

    }
    jQuery.validator.addMethod("alphanumeric", function(value, element){return this.optional(element) || /^[A-Za-z-.\s\']+$/i.test(value);}, "Letters, numbers, and underscores only please");
    $('#'+id+' .jform').validate();
});

$(window).load(function(){var num=0;$('.placeholder').each(function(){num++;var ithis=$(this),pval=ithis.attr('placeholder'),namval=ithis.attr('name');ithis.removeAttr('placeholder');ithis.parent().prepend('<input type="text" name="phtxt'+num+'" class="phtxt '+namval+'-holder" value="'+pval+'" />');ithis.hide();ithis.parent().children('.phtxt').on('focus',function(){$(this).hide();ithis.show().trigger('focus');    });ithis.on('blur',function(){if(ithis.hasClass('error')){$(this).parent().children('.phtxt').addClass('error');}else{$(this).parent().children('.phtxt').removeClass('error');}if(!ithis.val()){$(this).hide();$(this).parent().children('.phtxt').show();}});});});

})


